import React from 'react';

const App = () => {
  const people = [
    { name: "John", age: 30, position: 'Dev Ops', id: 1 },
    { name: "Stella", age: 49, position: 'Waiter', id: 2 },
    { name: "Bob", age: 39, position: 'Graphics', id: 3 },
    { name: "Bob", age: 39, position: 'Graphics', id: 3 },

  ];

  return (
    <div>
      {people.map((items)=>
      <p>{items.age }</p>
      )}
    </div>
  );
}

export default App;
